import { useState, useEffect } from "react"
import { useTranslation } from "react-i18next";
import { NavLink, useLocation } from "react-router-dom"
import { HashLink } from "react-router-hash-link";

const Navbar = () => {
    const [state, setstate] = useState(true);
    useEffect(() => {
        window.addEventListener("scroll", () => {
            if (window.scrollY >= 80) {
                setstate(false)
            } else {
                setstate(true)
            }
        });
    });
    const { hash } = useLocation();   
     
    const isActive = (iHash) => hash === iHash;

    const [t , i18n]= useTranslation()
    return (
        <nav>
            {state ?
                <div className="flex sm:flex-row flex-col relative sticky top-0 items-center sm:px-16 py-5 z-50">
                    <img src="/Images/logo.gif" className="w-16" alt="" />
                    <div className="sm:absolute cursor-pointer right-0 flex items-center text-sm sm:pr-20 sm:pt-0 pt-10">
                        <svg className="mx-3" width="22" height="22" viewBox="0 0 15 15" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                            <rect width="15" height="15" fill="url(#pattern1)" />
                            <defs>
                                <pattern id="pattern1" patternContentUnits="objectBoundingBox" width="1" height="1">
                                    <use xlinkHref="#image0_21_5951" transform="scale(0.00195312)" />
                                </pattern>
                                <image id="image0_21_5951" width="512" height="512" xlinkHref="data:image/png;base64," />
                            </defs>
                        </svg>
                        <svg className="mx-3 cursor-pointer" width="22" height="22" viewBox="0 0 15 15" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                            <rect width="15" height="15" fill="url(#pattern3)" />
                            <defs>
                                <pattern id="pattern3" patternContentUnits="objectBoundingBox" width="1" height="1">
                                    <use xlinkHref="#image0_21_5949" transform="scale(0.00195312)" />
                                </pattern>
                                <image id="image0_21_5949" width="512" height="512" xlinkHref="data:image/png;base64," />
                            </defs>
                        </svg>
                        <svg className="ml-3 mr-16 cursor-pointer" width="22" height="22" viewBox="0 0 15 15" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                            <rect width="15" height="15" fill="url(#pattern4)" />
                            <defs>
                                <pattern id="pattern4" patternContentUnits="objectBoundingBox" width="1" height="1">
                                    <use xlinkHref="#image0_21_5950" transform="scale(0.00195312)" />
                                </pattern>
                                <image id="image0_21_5950" width="512" height="512" xlinkHref="data:image/png;base64," />
                            </defs>
                        </svg>
                        <NavLink to={"/"} className="mr-2 rounded-3xl px-5 py-2 btnEffet" >{t('navbar')}</NavLink>
                        <select onChange={(e)=>{if(e.target.value=="francais"){i18n.changeLanguage('fr')} else if(e.target.value=="anglais"){i18n.changeLanguage('en')}}} className="mr-2 rounded-3xl px-5 py-2 btnEffet" style={{border:"none",outline:"none"}}>
                            <option value="anglais" className="text-black">EN</option>
                            <option value="francais" className="text-black">FR</option>
                        </select>
                    </div>
                </div>
                :
                <div className="grid grid-cols-5 justify-items-center bg-transparent flex fixed w-screen top-0 items-center  z-50" >
                    <HashLink smooth to={"/#About"} 
                        
                             className={isActive("#About")?"py-2 text-center font-normal drop-shadow-xl bgNavColor lg:text-lg text-xs":"py-2 text-center font-normal drop-shadow-xl bgNav lg:text-lg text-xs"} style={{fontFamily: 'Loew-medium'}}>
                        {t('navbarItem1')}
                    </HashLink>
                    <HashLink smooth to={"/#RoadMap"} className={isActive("#RoadMap")?"py-2 text-center font-normal drop-shadow-xl bgNavColor lg:text-lg text-xs":"py-2 text-center font-normal drop-shadow-xl bgNav lg:text-lg text-xs"} style={{fontFamily: 'Loew-medium'}}>
                        {t('navbarItem2')}
                    </HashLink>
                    <HashLink smooth to={"/#LookBook"} className={isActive("#LookBook")?"py-2 text-center font-normal drop-shadow-xl bgNavColor lg:text-lg text-xs":"py-2 text-center font-normal drop-shadow-xl bgNav lg:text-lg text-xs"} style={{fontFamily: 'Loew-medium'}}>
                        {t('navbarItem3')}
                    </HashLink>
                    <HashLink smooth to={"/#Faq"} className={isActive("#Faq")?"py-2 text-center font-normal drop-shadow-xl bgNavColor lg:text-lg text-xs":"py-2 text-center font-normal drop-shadow-xl bgNav lg:text-lg text-xs"} style={{fontFamily: 'Loew-medium'}}>
                        {t('navbarItem4')}
                    </HashLink>
                    <HashLink smooth to={"/#Project"} className={isActive("#Project")?"py-2 text-center font-normal drop-shadow-xl bgNavColor lg:text-lg text-xs":"py-2 text-center font-normal drop-shadow-xl bgNav lg:text-lg text-xs"} style={{fontFamily: 'Loew-medium'}}>
                        {t('navbarItem5')}
                    </HashLink>

                </div>
            }
        </nav>
    )
}
export default Navbar